import React from 'react';
import ReactPlayer from 'react-player';
import './VideoShow.css';

const VideoShow = ({ videoUrl }) => {
  let a;
  return (
    <div className="player-wrapper">
      <ReactPlayer
        className="react-player"
        playing
        controls
        url={videoUrl}
        width="70%"
        height="100%"
      />
    </div>
  );
};

export default VideoShow;
